import React from 'react';

class ShipSelector extends React.Component {
    constructor(props){
        super(props)
        this.state = {
            shipSelected: null,
            isCompressed: true
        }
    }

    render() {
        return(
        this.state.isCompressed ?  (
            <button>Select Targets</button>
        ) :
        (
            <div>
                <button>Golem</button>
                <button>Paladin</button>
                <button>Vargur</button>
                <button>Kronos</button>
                <button>Revelation</button>
                <button>Phoenix</button>
                <button>Moros</button>
                <button>Naglfar</button>
                <button>Gila</button>
                <button>Praxis</button>
                <button>Nestor</button>
                <button>Leshak</button>
                <button>Rattlesnake</button>
                <button>Heron</button>
            </div>
        )
        )
    }
}

export default ShipSelector;
